import React from "react";
import cook from "../img/cookFood.png";
import playStore from "../img/play-store.png";
import logo from '../img/logo.png';

export default function Cart() {
  return (
    <>
      <nav className="navbar navbar-expand-lg bg-body-transparant">
            <div className="container-fluid d-flex-row">
            <a className="nav-link fs-5 mx-2 text-center align-item-center" href="/"><img src={logo} style={{width: '4rem'}} alt="logo"></img></a>
            <a className="nav-link active" href="/">GoFoody</a>
                <div className="collapse navbar-collapse container justify-content-end" id="navbar">
                  <ul className="navbar-nav">
                    <li className="nav-item px-4">
                      <a className="nav-link active" href="/"><i className="fa-sharp fa-solid fa-circle-info"></i> Help</a>
                    </li>
                  </ul>
                </div>
            </div>
      </nav>
    </>
  );
}
